import React from 'react';

// Icon components
const BackArrowIcon = () => (
  <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 19l-7-7 7-7" />
  </svg>
);

const AvatarIcon = () => (
  <div className="w-10 h-10 bg-gradient-to-br from-blue-400 to-purple-500 rounded-full flex items-center justify-center text-white font-semibold text-sm">
    J
  </div>
);

interface AlertsCenterProps {
  onBack: () => void;
}

const AlertsCenter: React.FC<AlertsCenterProps> = ({ onBack }) => {
  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-white shadow-sm border-b border-gray-200 px-4 py-3">
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-3">
            <button
              onClick={onBack}
              className="p-1 text-gray-600 hover:text-gray-800 transition-colors"
            >
              <BackArrowIcon />
            </button>
            <AvatarIcon />
            <div>
              <h1 className="text-lg font-semibold text-gray-900">Jamie</h1>
            </div>
          </div>
          <div className="flex items-center">
            <h2 className="text-xl font-bold text-gray-900">Alerts & Safety</h2>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="px-4 py-6">
        {/* Content will be added in next steps */}
        <div className="text-center text-gray-500 mt-8">
          <p>Alerts content will be implemented in the next step</p>
        </div>
      </main>
    </div>
  );
};

export default AlertsCenter;
